import React, { useState } from 'react';



const App = ( ) => {

let newTime = new Date().toLocaleTimeString();

const [ctime, setCtime] = useState();

return(
  <>
    <h1> {ctime} </h1>
    <button> Get Time </button>

  </>
);
}

export default App;
